import React, {useState, Fragment} from 'react'
import {BlockPicker} from 'react-color'
import './App.css'

function App() {
  let locations = [
    {
      name: 'us',
      areas: [
        {country: 'ðŸ‡ºðŸ‡¸', region: 'oregon', code: 'us-east-1', color: '#023414', display: false},
        {country: 'ðŸ‡ºðŸ‡¸', region: 'Designer', code: 'us-east-2', color: '#F43254', display: false},
        {country: 'ðŸ‡ºðŸ‡¸', region: 'Designer', code: 'us-west-2', color: '#F43254', display: false},
        {country: 'ðŸ‡ºðŸ‡¸', region: 'Designer', code: 'us-west-2', color: '#F43254', display: false},
      ],
    },
    {
      name: 'af',
      areas: [
        {country: 'ðŸ‡ºðŸ‡¸', region: 'oregon', code: 'af-south-1', color: '#023414', display: false},
      ],
    },
    {
      name: 'ap',
      areas: [
        {country: 'ðŸ‡ºðŸ‡¸', region: 'oregon', code: 'ap-east-1', color: '#023414', display: false},
        {country: 'ðŸ‡ºðŸ‡¸', region: 'Designer', code: 'us-east-2', color: '#F43254', display: false},
        {country: 'ðŸ‡ºðŸ‡¸', region: 'oregon', code: 'us-east-1', color: '#023414', display: false},
        {country: 'ðŸ‡ºðŸ‡¸', region: 'Designer', code: 'us-east-2', color: '#F43254', display: false},
        {country: 'ðŸ‡ºðŸ‡¸', region: 'oregon', code: 'us-east-1', color: '#023414', display: false},
        {country: 'ðŸ‡ºðŸ‡¸', region: 'Designer', code: 'us-east-2', color: '#F43254', display: false},
        {country: 'ðŸ‡ºðŸ‡¸', region: 'oregon', code: 'us-east-1', color: '#023414', display: false},
        {country: 'ðŸ‡ºðŸ‡¸', region: 'Designer', code: 'us-east-2', color: '#F43254', display: false},
      ],
    },
    {
      name: 'ca',
      areas: [
        {country: 'ðŸ‡ºðŸ‡¸', region: 'Designer', code: 'us-east-2', color: '#F43254', display: false},
      ],
    },
    {
      name: 'eu',
      areas: [
        {country: 'ðŸ‡ºðŸ‡¸', region: 'oregon', code: 'us-east-1', color: '#023414', display: false},
        {country: 'ðŸ‡ºðŸ‡¸', region: 'Designer', code: 'us-east-2', color: '#F43254', display: false},
        {country: 'ðŸ‡ºðŸ‡¸', region: 'oregon', code: 'us-east-1', color: '#023414', display: false},
        {country: 'ðŸ‡ºðŸ‡¸', region: 'Designer', code: 'us-east-2', color: '#F43254', display: false},
        {country: 'ðŸ‡ºðŸ‡¸', region: 'oregon', code: 'us-east-1', color: '#023414', display: false},
        {country: 'ðŸ‡ºðŸ‡¸', region: 'Designer', code: 'us-east-2', color: '#F43254', display: false},
      ],
    },
    {
      name: 'me',
      areas: [
        {country: 'ðŸ‡ºðŸ‡¸', region: 'oregon', code: 'us-east-1', color: '#023414', display: false},
      ],
    },
    {
      name: 'sa',
      areas: [
        {country: 'ðŸ‡ºðŸ‡¸', region: 'oregon', code: 'us-east-1', color: '#023414', display: false},
      ],
    }
  ]

  let colorPicker = {
    "us-east-1": false,
    "us-east-2": false,
  }

  const [color, setColor] = useState(locations)
  const [displayColorPicker, setDisplayColorPicker] = useState(colorPicker)

  const updateColor=(color) => {
    setColor(color.hex)
  }

  const handleClick = (code) => {
    // let displays = colorPicker[code]
    setDisplayColorPicker(previousState => {
      return { ...previousState, [code]: true }
    });
  }

  const handleClose = () => {
    setDisplayColorPicker(false)
  }

  const handleChange = (color) => {
    setColor(color)
  }

  function classNames(...classes) {
    return classes.filter(Boolean).join(' ')
  }

  return (
    <div className="bg-white w-96">
      <header className="">
        <p className="text-xl pl-4 pt-3 font-bold">AWS console region color</p>

        <div className="m-3">
          <div className="px-4">
            <div className="mt-4 flex flex-col">
              <div className="-my-2 -mx-4 overflow-x-auto">
                <div className="inline-block min-w-full py-2 align-middle md:px-6 lg:px-8">
                  <div className="overflow-hidden shadow ring-1 ring-black ring-opacity-5 md:rounded-lg">

                    <table className="min-w-full">
                      <thead className="bg-white">
                      <tr>
                        <th scope="col"
                            className="py-1.5 pl-4 pr-3 text-left text-sm font-semibold text-gray-900 sm:pl-6">
                          Country
                        </th>
                        <th scope="col" className="pl-1 pr-1 py-1.5 text-left text-sm font-semibold text-gray-900">
                          Region
                        </th>
                        <th scope="col" className="px-3 py-1.5 text-left text-sm font-semibold text-gray-900">
                          Code
                        </th>
                        <th scope="col" className="px-3 py-1.5 text-left text-sm font-semibold text-gray-900">
                          Color
                        </th>
                      </tr>
                      </thead>
                      <tbody className="bg-white">

                      {/*location name*/}
                      {locations.map((location) => (
                        <Fragment key={location.name}>
                          <tr className="border-t border-gray-200">
                            <th
                              colSpan={5}
                              scope="colgroup"
                              className="bg-gray-50 px-4 py-1.5 text-left text-sm font-semibold text-gray-900 sm:px-6 text-center"
                            >
                              {location.name}
                            </th>
                          </tr>
                          {/*sub location*/}
                          {location.areas.map((area) => (
                            <tr
                              className={classNames('border-gray-300 border-t')}
                            >
                              <td
                                className="whitespace-nowrap py-1.5 pl-4 pr-3 text-sm font-medium text-gray-900 sm:pl-6">
                                {area.country}
                              </td>
                              <td className="whitespace-nowrap pl-1 pr-3 py-1.5 text-sm text-gray-500">
                                {area.region}
                              </td>
                              <td className="whitespace-nowrap px-3 py-1.5 text-sm text-gray-500">
                                {area.code}
                              </td>
                              <td className="whitespace-nowrap px-3 py-1.5 text-sm text-gray-500">
                                {/*{area.color}*/}
                                <button
                                  type="button"
                                  className="rounded-md border border-transparent bg-indigo-600 px-4 py-2 text-sm font-medium text-white shadow-sm hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-indigo-500 focus:ring-offset-2 text-center align-middle"
                                  style={{backgroundColor: area.color}}
                                  onClick={() => {handleClick(area.code)}}
                                >
                                </button>
                                {area.display ?
                                  <div className="absolute z-[2]">
                                    <div className="fixed top-0 right-0 left-0 bottom-0" onClick={handleClose} />
                                    <BlockPicker color={color} onChangeComplete={(color) => updateColor(color)}/>
                                  </div>
                                  : null}
                              </td>
                            </tr>
                          ))}
                        </Fragment>
                      ))}
                      </tbody>
                    </table>
                  </div>
                </div>
              </div>
            </div>
            <div className="mt-4 mb-3 flex justify-center">
              <button
                type="button"
                className="rounded-md border border-transparent bg-indigo-600 px-4 py-2 text-sm font-medium text-white shadow-sm hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-indigo-500 focus:ring-offset-2 sm:w-auto"
              >
                Update
              </button>
            </div>
          </div>
          <div className="text-center">
            <p>About</p>
          </div>
        </div>
      </header>
    </div>
  );
}

export default App

